#include <iostream>
#include <stdlib.h>
#include <string>

using namespace std;


void edit_distance(string s1, string s2, int len_s1, int len_s2, int * table, int k, int sub_start, bool *used){
    int res;
    if (used[sub_start] == true){
        return;
    } else{
        used[sub_start] = true;
    }
    for (int ei = 0; ei < len_s1; ei++){
        for (int ej = 0; ej < len_s2; ej++){
            if (ei == 0){
                table[ej] = ej;
            }
            else if (ej == 0){
                table[ei*len_s2] = ei;

            }
            else if (s1[ei-1] == s2[ej-1]){
                res = table[(ei-1)*len_s2 + (ej-1)];
                table[ei*len_s2 + ej] = res;
            }
            else {
                res = min(
                        table[(ei-1)*len_s2 + ej],
                        min(
                                table[ei*len_s2 + ej-1],
                                table[(ei-1)*len_s2 + ej-1])
                ) + 1;
                table[ei*len_s2 + ej] = res;
            }
        }
    }

    for (int pr = 1; pr < len_s2; pr++){
        if (table[(len_s1-1)*len_s2 + pr] <= k){
            cout << sub_start + 1 << " " << pr << endl;
        }
    }

}

int main(){

    int k = 42;
    string s("");
    string t("");
    int len_s = s.length();
    int len_t = t.length();
    bool used_start[10 * 5000] = {false};
    int len_chunk = len_s / (k + 1);

    for (int t_ind = 0; t_ind <= len_t - len_chunk; t_ind++){
        for (int s_ind = 0; s_ind <= len_s -len_chunk; s_ind++){
            if (t.substr(t_ind, len_chunk) == s.substr(s_ind, len_chunk)) {
                int start_center = t_ind - s_ind;
                for (int start_neighbor = -(2*k); start_neighbor <= 2*k; start_neighbor++){
                    int start_candidate = start_center + start_neighbor;

                    if (start_candidate < len_t && start_candidate >= 0){
                        string substring = t.substr(start_candidate, min(len_t - start_candidate, len_s + k));
                        int len_substring = substring.length();
                        int *table = (int *) calloc((len_s + 1) * (len_substring + 1), sizeof(int));

                        edit_distance(s, substring, len_s + 1, len_substring + 1, table, k, start_candidate, used_start);

                        free(table);
                    }
                }


            }
        }
    }



    return 0;
}



